pragma solidity ^0.4.23;

import "./role/Attendee.sol";
import "./role/Admin.sol";
import "./status/Status.sol";
import "./util/Math.sol";

/**
 * @title Parity
 * join party by smart party
 */

contract Party is Status, Admin, Attendee {

    string public name;//
    uint256 public applyFee; //
    uint256 public returnBonus; //

    uint256 public costFee; //,

    uint256 public ownerBalance; //()
    uint256 public liabBalance; //()


    /* constructor function */
    constructor (
        string _name,
        uint256 _totalOfAttendee,
        uint256 _applyFee,
        uint256 _returnBonus
    ) Attendee(_totalOfAttendee) public {
        require(_applyFee >= _returnBonus);

        name = _name;
        applyFee = _applyFee;
        returnBonus = _returnBonus;
        costFee = Math.safeSub(applyFee, returnBonus);
    }


    event ApplyEvent(address _addr, string _encryption);
    event AttendEvent(address[] _addrs);

    event ApplyEndEvent();
    event CancelEvent();
    event FinishEvent();

    event ReturnBonusEvent(address _addr, uint256 _returnBonus);
    event UpdateTotalOfAttendeeEvent(address _addr, uint256 _totalOfAttendee);

    event FreezeContractEvent();
    event UnFreezeContractEvent();

    function apply(address _address) external payable onlyCanApply{//
        require(_address != address(0));
        require(!isApplied(_address));
        require(msg.value == applyFee);

        updateAttendeeApplied(_address);

        ownerBalance = Math.safeAdd(ownerBalance, costFee);

        emit ApplyEvent(_address, '');
    }

    function getReturnBonus(address _address) external onlyEnded{//()pullpush
        require(_address != address(0));
        require(isApplied(_address));


        updateAttendeeIsReturned(_address);

        _address.transfer(returnBonus);

        emit ReturnBonusEvent(_address, returnBonus);
    }

    function updateAttendedList(address[] _addressList) external onlyActive onlyAdmin {//
        updateAttendeeAttendedList(_addressList);

        emit AttendEvent(_addressList);
    }

    function applyEnd() external onlyCanApply onlyAdmin {//
        updateStatusApplyEnd();//

        emit ApplyEndEvent();
    }

    function cancel() external onlyActive onlyAdmin {//
        updateStatusCancel();//

        returnBonus = applyFee;//

        emit CancelEvent();
    }

    function finish(address _address) external onlyActive onlyAdmin {//
        require(numOfAttended > 0);//

        updateStatusFinish();//

        uint256 totalBalance = address(this).balance;//ETH
        liabBalance = Math.safeSub(totalBalance, ownerBalance);//

        returnBonus = Math.safeDiv(liabBalance, numOfAttended);//  wei

        uint256 diffBalance = liabBalance % numOfAttended;//
        if(diffBalance != 0) {
            ownerBalance = Math.safeAdd(ownerBalance, diffBalance);//
            liabBalance = Math.safeMul(numOfAttended, returnBonus);//
            assert(totalBalance == Math.safeSub(ownerBalance, liabBalance));//=+
        }

        if(ownerBalance > 0) {
            _address.transfer(ownerBalance);//
            ownerBalance = 0;//transfer2300gasupdateStatusFinish
        }

        emit FinishEvent();
    }

    function updateTotalOfAttendee(uint256 _totalOfAttendee) external onlyActive onlyAdmin {//
        updateAttendeeTotalOfAttendee(_totalOfAttendee);

        emit UpdateTotalOfAttendeeEvent(msg.sender, _totalOfAttendee);
    }

    //bug
    function freezeContract() external onlyUnFreeze onlyOwner{//
        updateStatusFreeze();

        emit FreezeContractEvent();
    }

    function unFreezeContract() external onlyFreeze onlyOwner{//
        updateStatusUnFreeze();

        emit UnFreezeContractEvent();
    }
}
